import React from "react";

route = [
  {
    path: "/website",
    sidebarLink: ["WebSiteInfo", "Credentials", "Status"]
  },
  {
    path: "/projects",
    sidebarLink: ["ProjectLink", "ProjectLink", "ProjectLink"]
  }
];

export default route;
